import "./TodoList.css";

const Todo = (props) => {
    return (
        <ul className="todo">
            { props.todoList.map((todo, index) => {
                return
                    <>
                        <li key={ index }> { todo } </li> <input type="checkbox" />
                    </>
            }) }
        </ul>
    );
}

export default Todo;
